import React from 'react';
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from 'react-router-dom';
import {
  AppBar,
  Button,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  Toolbar
  } from '@material-ui/core';
import { withStyles } from '@material-ui/core/styles';
import {
    Apps as AppsIcon,
    Wifi as WifiIcon,
    Public as PublicIcon,
    Security as SecurityIcon
  } from '@material-ui/icons';

import ThreatMap from './ThreatMap';

const StyledButton = withStyles({
  root: {
    color: "white"
  }
})(Button);

function Dashboard(){
  return(
    <div>
      <List>
          <ListItem>
            <ListItemIcon>
              <PublicIcon />
            </ListItemIcon>
            <ListItemText
                primary="Web Protection"/>
          </ListItem>
          <ListItem>
            <ListItemIcon>
              <AppsIcon />
            </ListItemIcon>
            <ListItemText primary="App Protection"/>
          </ListItem>
          <ListItem>
            <ListItemIcon>
              <WifiIcon />
            </ListItemIcon>
            <Button color="primary" component={Link} to="/network-protection">
                Network Protection
            </Button>
          </ListItem>
          <ListItem>
            <ListItemIcon>
              <SecurityIcon />
            </ListItemIcon>
            <ListItemText primary="System Protection" />
          </ListItem>
        </List>
      </div>
  );
};

export default Dashboard;
